function servicetask130(attempt, message) {
	log.info("### Inicialização da Cotação (Solicitação de compra avulsa) no TOTVS Protheus - solicitarServicoServicetask130 - INICIO ###");

	var cCusto        = '"'+hAPI.getCardValue("codCentroCusto")+'"';
	var cDescCc       = '"'+hAPI.getCardValue("descricao")+'"';
	var cSolicitante  = '"'+hAPI.getCardValue("nameUser")+'"';
	var cNumProcesso  = '"'+hAPI.getCardValue ("processo")+'"';
	var cFilial       = '"'+hAPI.getCardValue("codFilial")+'"';

	var objBackEnd = JSON.parse('{"cfilialc": '+cFilial+', "cempresac":"01", "ccentrocusto":'+cCusto+', "csolicitante":'+cSolicitante+', "cnumprocesso":'+cNumProcesso+', "cdesccentrocusto":'+cDescCc+'}');

	//input utilizada para armazenar as cotacoes atualizadas
	var inputCotacoes = hAPI.getCardValue("cotacoesInput");
	var cotacoes = JSON.parse(inputCotacoes);

	for (var countProd = 0; countProd < cotacoes.length; countProd++) {
		objBackEnd["cnumcotacao"] = cotacoes[countProd].codNumCotacao;

		var fornecedores = cotacoes[countProd].fornecedores;

		for(var countFornec = 0; countFornec < fornecedores.length; countFornec++){
			if(fornecedores[countFornec].ganhador == true){
				objBackEnd["cotacao"+(countProd+1)] = JSON.parse('{"citemcotac":"'+fornecedores[countFornec].codItemCotacao+'", "cqtdprod":"'+cotacoes[countProd].quantidade+'", "cnprod":"'+cotacoes[countProd].codProduto+'", "cfornecedor":"'+fornecedores[countFornec].fornecedor+'", "carmazem":"'+cotacoes[countProd].codArmazem+'", "cprecounid":"'+fornecedores[countFornec].precoUnitario+'", "cprecototal":"'+fornecedores[countFornec].precoTotal+'", "ccodpag":"'+fornecedores[countFornec].condPagamento+'", "clojaforn": "'+fornecedores[countFornec].lojaForn+'"}');
			}			
		}
	}

	log.info("INFO OBJBACK::::"+JSON.stringify(objBackEnd));

	 try {

		var clientService = fluigAPI.getAuthorizeClientService();	
		var compID = getValue("WKCompany");

		var data = {
			companyId: compID + "",
			serviceCode: "WSRESTPROTHEUS",
			endpoint: "/WSRESTCOT",
			method: "post",
			timeoutService: "200",
			params: objBackEnd,
			options : {
				encoding : "iso-8859-1",
				mediaType: "application/json"
			}
		}

		var vo = clientService.invoke(JSONUtil.toJSON(data));

		log.info("response::"+vo.getResult());

		if(vo.getResult() == null || vo.getResult().isEmpty()){
			throw "Erro na integração da requisição de contratação de serviços.";	
		}else{
			var response =  vo.getResult();
			var erroRest =  "com.fluig.authorize.client.exception.ClientBasicAuthorizeException: org.apache.http.conn.HttpHostConnectException: Connect to 192.168.200.66:8012 [/192.168.200.66] failed: Connection refused: connect";			

			log.info("RESPONSE:::"+response);

			if ((response.indexOf(erroRest)) == 0){
				throw "Não foi possível estabelecer uma conexçao com o Protheus. Tente novamente!"
			}else {
				var responseJson = JSON.parse(response);//Para os erros que são gerados via Protheus

				if(responseJson.errorCode == 500){
					throw "Erro interno no servidor! Entre em contato com o administrador do sistema.";
				}else if(responseJson.errorCode == 401 || responseJson.errorCode == 403 || responseJson.errorCode == 404 ){
					throw "Erro na autenticação/endereço inexistente"; 
				}
			}
		}	

	 } catch (error) {
		log.info("Erro::::"+error);
		throw error;
	 }

	 log.info("### Finalização da Cotação (Solicitação de contratação de serviços) no TOTVS Protheus - solicitarServicoServicetask130 - FIM ###");
}

function servicetask275(attempt, message) {

	// Pega os valores que pertecem a tabela de produtos que estão armazenado dentro de uma lista na function modalBuscarProduto
	var produtos = hAPI.getCardValue("listaProdutos");	
	var produtosFormatado = JSON.parse("["+produtos+"]");
	// Monta objeto para envio no backend
	var objBackEnd = {
		"cuser": hAPI.getCardValue("nameUser"),
		"csolicitacao": hAPI.getCardValue ("processo"),
		"cfilial": hAPI.getCardValue("codFilial"),
		"cempresa":"01"
	};
	// Converte lista em objetos sequenciais 
	for(var count = 0; count < produtosFormatado.length; count++){            
		objBackEnd["produtos"+(count+1)] = JSON.parse('{"cidProduto":"'+produtosFormatado[count].cidProduto+'", "cquantidade":"'+produtosFormatado[count].cquantidade+'", "cobs":"'+produtosFormatado[count].cobs+'", "ccusto":"18.01.02", "carmazem":"01MZ01"}');
	// 	log.info("produto111"+item);
		log.info(count);
	}

	try {
		var clientService = fluigAPI.getAuthorizeClientService();	
		var compID = getValue("WKCompany");

		var data = {
				companyId: compID + "",
				serviceCode: "WSRESTPROTHEUS",
				endpoint: "/WSARMAZEM",
				method: "post",
				timeoutService: "200",
				params: objBackEnd,
				options : {
					encoding : "iso-8859-1",
					mediaType: "application/json"
				}
		}

		var vo = clientService.invoke(JSONUtil.toJSON(data));

		if(vo.getResult() == null || vo.getResult().isEmpty()){
			throw "Erro na integração da requisição de materiais.";	
		}else{	
			log.info("### Inclusão de Cliente no TOTVS Protheus - servicetask44 - response - "+vo.getResult());	
			var response = JSON.parse(vo.getResult());	
			if(response.STATUS == undefined || response.STATUS == null){	
				throw "Erro de comunicação com o Protheus";	
			}else{
				if(response.STATUS == false){
					throw response.MESSAGE;	
				}
			}
		}
		log.info("### Inclusão de Cliente no TOTVS Protheus - servicetask44 - FIM ###");

	} catch (error) {
		log.info("DEU RUIM...");
	}

}

function beforeTaskSave(colleagueId, nextSequenceId){
    var state      = getValue("WKNumState");
    var nextAtv  = getValue("WKNextState");

    //validação dos campos obrigatórios na abbertura da solicitação

        if (hAPI.getCardValue("grupo") == null || hAPI.getCardValue("grupo") ==  "") {
            throw "Informe um grupo.";
        }

        if (hAPI.getCardValue("codCentroCusto") == null || hAPI.getCardValue("codCentroCusto") ==  "") {
            throw "Informe um centro de custo através da pesqusisa.";
        }

        if (hAPI.getCardValue("descricao") == null || hAPI.getCardValue("descricao") ==  "") {
            throw "Informe o centro de custo.";
        }

        if (hAPI.getCardValue("empresa") == null || hAPI.getCardValue("empresa") ==  "") {
            throw "Informe a empresa.";
        }

        if (hAPI.getCardValue("listaProdutos") == "" && hAPI.getCardValue('existeProdutoNovo') == "false") {
            throw "Informe ao menos um serviço ou então cadastre.";
        }


    
    //Validação dos campos obrigatórios em outros estados	
    if (state == "433") {		
    	if (hAPI.getCardValue("validacaoJuridico") == "") {
    		throw "Informe se necessita validar o contrato no setor jurídico.";
    	}
    	
		if (hAPI.getCardValue("contatoJuridico") == "" && hAPI.getCardValue("validacaoJuridico") == "sim") {
			throw "Informe o contato.";
		}
		
		if (hAPI.getCardValue("prazoJuridico") == ""  && hAPI.getCardValue("validacaoJuridico") == "sim") {
			throw "Informe o prazo estimado para validar o contrato.";
		}
		
        var anexos   = hAPI.listAttachments();
        var temAnexo = false;

        if (anexos.size() > 0) {
            temAnexo = true;
        }

        if (!temAnexo  && hAPI.getCardValue("validacaoJuridico") == "sim") {
            throw "Favor anexar o contrato.";
        }
    }

    if (state=="511") {
		var quantidadeServicos = hAPI.getCardValue("countValidaInputServico");		
		//Verifica se os campos são vazios
		for (var count = 0;  count <  quantidadeServicos; count++) {
			if (hAPI.getCardValue("dataInicioExecucaoServico_"+count) == "") {
				throw "Informe o início da execução do serviço.";
			}	
			
			if (hAPI.getCardValue("dataFimExecucaoServico_"+count) == "") {
				throw "Informe a data do término da execução do serviço.";
			}	
		}				
	}
	
	if (state=="514") {
		var quantidadeServicos = hAPI.getCardValue("countValidaInputServico");		
		//Verifica se os campos são vazios
		for (var count = 0;  count <  quantidadeServicos; count++) {
			if (hAPI.getCardValue("dataInicioExecucaoServico_"+count) == "") {
				throw "Informe o início da execução do serviço.";
			}	
			
			if (hAPI.getCardValue("dataFimExecucaoServico_"+count) == "") {
				throw "Informe a data do término da execução do serviço.";
			}	
		}				
	}
}

function servicetask44(attempt, message) {
	log.info("### Inicialização Solicitação de serviço no TOTVS Protheus ###");
	// Pega os valores que pertecem a tabela de produtos que estão armazenado dentro de uma lista na function modalBuscarProduto
	var produtos = hAPI.getCardValue("listaProdutos");	
	var produtosFormatado = JSON.parse("["+produtos+"]");

	var cUser    = '"'+hAPI.getCardValue("nameUser")+'"';
	var cCusto   = '"'+hAPI.getCardValue("codCentroCusto")+'"';
	var cDescCc  = '"'+hAPI.getCardValue("descricao")+'"';
	var cFilial       = '"'+hAPI.getCardValue("codFilial")+'"';
	var cArmazem       = '"'+hAPI.getCardValue("codArmazem")+'"';
	var cNumProcesso  = '"'+hAPI.getCardValue("processo")+'"';
	var itens = [];

	// Monta objeto para envio no backend
	var objBackEnd = JSON.parse('{"cfilialc":'+cFilial+', "cempresac":"01", "ccentrocusto":'+cCusto+', "cuser":'+cUser+', "csolicitacao":'+cNumProcesso+', "cdesccentrocusto":'+cDescCc+'}');

	// Formata lista de produtos a ser enviada
	for(var count = 0; count < produtosFormatado.length; count++){
		var item = "";
		item = JSON.parse('{"cidProduto":"'+produtosFormatado[count].cidProduto+'", "cquantidade":"'+produtosFormatado[count].cquantidade+'", "cobs":"'+produtosFormatado[count].cobs+'", "ccusto":'+cCusto+', "ccustodesc":'+cDescCc+',  "carmazem":'+cArmazem+'}');			   
		itens.push(item);
	}

	objBackEnd["itens"] = itens;

	log.info("INFO OBJBACK::::"+JSON.stringify(objBackEnd));

	try {
		var clientService = fluigAPI.getAuthorizeClientService();	
		var compID = getValue("WKCompany");

		var data = {
				companyId: compID + "",
				serviceCode: "WSRESTPROTHEUS",
				endpoint: "/WSSERVICO",
				method: "post",
				timeoutService: "200",
				params: objBackEnd,
				options : {
					encoding : "iso-8859-1",
					mediaType: "application/json"
				}
		}

		var vo = clientService.invoke(JSONUtil.toJSON(data));
		log.info("response::"+vo.getResult());

		if(vo.getResult() == null || vo.getResult().isEmpty()){
			throw "Erro na integração.";	
		}else{
			var response =  vo.getResult();
			var erroRest =  "com.fluig.authorize.client.exception.ClientBasicAuthorizeException: org.apache.http.conn.HttpHostConnectException: Connect to 192.168.200.66:8012 [/192.168.200.66] failed: Connection refused: connect";			

			log.info("RESPONSE:::"+response);

			if ((response.indexOf(erroRest)) == 0){
				throw "Não foi possível estabelecer uma conexçao com o Protheus. Tente novamente!"
			}else {
				var responseJson = JSON.parse(response);//Para os erros que são gerados via Protheus

				if(responseJson.errorCode == 500){
					throw "Erro interno no servidor! Entre em contato com o administrador do sistema.";
				}else if(responseJson.errorCode == 401 || responseJson.errorCode == 403 || responseJson.errorCode == 404 ){
					throw "Erro na autenticação/endereço inexistente"; 
				}
			}
		}

	} catch (error) {
		log.info("Erro::::"+error);
		throw error;
	}
	log.info("### Finalização Solicitação de serviço no TOTVS Protheus ###");		
}

